import React from 'react';
import { Link } from 'react-router-dom';

const About = () => {
  return (
    <>
      <header>
        <h1>MY About Pge</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About </Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
      </header>
    </>
  );
};

export default About;
